    function requestIndemnity(uint256 _value) external {
        require(activeMembers[msg.sender], "Member is not active");
        // require(balances[msg.sender] >= _value, "Insufficient funds");
        require(!statusIndemnity, "Indemnity already requested");
        indemnityRequests[msg.sender] = _value;
        statusIndemnity = true;
        userRequestingIndemnity.push(msg.sender);
    }

    // Funo voltada para o pagamento da indenizao solicitada
    // essa funo atende ao seguint256e requisito: 
    // requisito 6: aprovao dos pedidos de indenizao
    // Funo para aprovao de indenizao
    function approveIndemnity(address payable memberRequesting) external payable isOwner{
        require(statusIndemnity == true, "Indemnity not requested");
        require(getBalance() >= indemnityRequests[userRequestingIndemnity[0]], "Insufficient funds");
        if (statusIndemnity == true){
            memberRequesting.transfer(indemnityRequests[userRequestingIndemnity[0]]);
            balances[userRequestingIndemnity[0]] -= indemnityRequests[userRequestingIndemnity[0]];
        }
        statusIndemnity = false;
    }

